PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "t_actors" (
	`name`	TEXT,
	`short_name`	TEXT,
	`url`	TEXT,
	`favor`	INTEGER DEFAULT 0,
	`last_read_time`	INTEGER,
	PRIMARY KEY(`name`)
);
CREATE TABLE `t_magnets` (
	`av_number`	TEXT NOT NULL,
	`magnet`	TEXT,
	`create_time`	INTEGER
);
CREATE TABLE "t_movies" (
	`av_number`	TEXT,
	`actor`	TEXT,
	`title`	REAL,
	`short_name`	TEXT,
	`remote_cover`	REAL,
	`public_time`	TEXT,
	`local_cover`	TEXT,
	`create_time`	TEXT,
	`local`	INTEGER DEFAULT 0,
	`classic`	INTEGER DEFAULT 0,
	`vr`	INTEGER DEFAULT 0,
	`trash`	INTEGER DEFAULT 0,
	`wrong_pic`	INTEGER,
	`magnet`	TEXT,
	`skip`	INTEGER DEFAULT 0,
	`last_read_time`	INTEGER DEFAULT 0,
	`forcast`	INTEGER DEFAULT 0,
	`download`	INTEGER DEFAULT 0,
	PRIMARY KEY(`av_number`)
);
COMMIT;
